import React from 'react';
import './_Banner.scss';
import gif from '../img/gato1.gif';

export default function Banner() {
    return (
        <div className="banner">
            <img src={gif} />
            <video width="500" autoplay>
                <source src={gif} type="video/mp4"/>
            </video>
        </div>
    )
}
